question: Start
subquestion: |
  This tool will help you determine whether the legal protection of databases as laid out by the Database Directive are applicable in your case. 
  
  <font size="2"> [Directive 96/9/EC](https://eur-lex.europa.eu/legal-content/EN/TXT/?uri=celex%3A31996L0009) of the European Parliament and of the Council of 11 March 1996 on the legal protection of databases
  
  
continue button field: start
---
question: Question
subquestion: |
  Does the database constitute the author's own intellectual creation by reason of the selection or arrangement of the contents?
  
  
  <font size="2">***Source: Art.3(1) Directive on the legal protection of databases***
  
  
  
field: copyrighted_database
buttons:
  - "Yes"
  - "No"
---
event: not_sui_generis_protected
question: Conclusion - The Directive is ***not*** applicable to your case
subquestion: |
  The conditions for the protection of the database have not been fulfilled, and the Directive is not applicable in your case. 
  
  
  <font size="2">***Source: Art. 7(1) Directive on the legal protection of databases***
---
event: not_author_or_rightholder
question: Conclusion - The Directive is ***not*** applicable to your case
subquestion: |
  The protection afforded by the Directive to databases only applies to authors of copyright protected databases, thus the Directive is not applicable in your case as you do not qualify as an author or a rightholder.
  
  <font size="2">***Source: Art. 3 and 4 Directive on the legal protection of databases***
---
question: Question
subquestion: |
  Have you arranged in a a systematic or methodical way a collection of independent works, data or other materials, so that they are individually accessible by electronic or other means?
  
  <font size="2">***Source: Art.1(2) Directive on the legal protection of databases***
field: database_requirements
buttons:
  - "Yes"
  - "No"
---
event: possible_rightholder
question: Conclusion - The Directive is ***not*** applicable to your case
subquestion: |
  You do not fulfill the conditions of a database maker required by the Directive, and the Directive does not apply to your case.
  
  You can however qualify for protection if you are a rightholder, and all of the required conditions of the Directive are fulfilled by the database maker.
  
  Use the tool to answer the questions from the viewpoint of the database maker to see if the other conditions for protection are also fulfilled. 
  
  <font size="2">***Source: Art. 1(2) Directive on the legal protection of databases***
---
question: Question
subquestion: |
  Has there been qualitatively and/or quantitatively a substantial investment in:
  
  - Obtaining the content
  - Verifying the content
  - Presentation of the content ?
  
  
  <font size="2">***Source: Art.7(1) Directive on the legal protection of databases***
field: sui_generis_investment
buttons:
  - "Yes"
  - "No"
---
question: Question
subquestion: |
  Was the substantive investment in obtaining / verifying / presentation of the content done to prevent the permanent or temporary transfer of all or a substantial part of the contents of the database to another medium? 
  
  
  <font size="2">***Source: Art.7(2)(a) Directive on the legal protection of databases***
  
field: sui_generis_extraction
buttons:
  - "Yes"
  - "No"
---
question: Question
subquestion: |
  Was the substantive investment in obtaining / verifying / presentation of the content done to prevent the making available to the public of all or a substantial part of the contents of a database by the distribution of copies, by renting, by on-line or other forms of transmission?
  
  
  <font size="2">***Source: Art.7(2)(b) Directive on the legal protection of databases***
field: sui_generis_re_utilization
buttons:
  - "Yes"
  - "No"
---
event: protected_partly
question: Conclusion - The Directive ***is*** applicable to your case
subquestion: |
  The conditions for the protection of the database have been fulfilled, and the Directive is applicable. However, users are allowed to extract and re-utilize parts of the databases contents which are insubstantial, for any purposes whatsoever. 
  
  
  <font size="2">***Source: Art. 7, 8, 9 and 11 Directive on the legal protection of databases***
  
  
---
question: Question
subquestion: |
  Was the database made available to the public wholly or partly? 
field: made_public
buttons:
  - "Yes"
  - "No"
---
question: Question
subquestion: |
  Is the database maker a national of a European Union Member State?
  
  
  
  <font size="2">***Source: Art.11(1) Directive on the legal protection of databases***
field: national_of_ms
buttons:
  - "Yes"
  - "No"
---
question: Question
subquestion: |
  Is the database maker habitually resident in one of the European Union Member States?
  
  
  <font size="2">***Source: Art.11(1) Directive on the legal protection of databases***
field: habitual_resident
buttons:
  - "Yes"
  - "No"
---
question: Question
subquestion: |
  Is the database maker a firm or company formed in accordance with the law of a Member State, and have your registered office, central administration or principal place of business within the community?
  
  
  <font size="2">***Source: Art.11(2) Directive on the legal protection of databases***
field: registered_office
buttons:
  - "Yes"
  - "No"
---
question: Question
subquestion: |
  Was the database created in a third-country, but there is an agreement between the European Commission and the third-country for the protection of databases?
  
  
  
  <font size="2">***Source: Art.11(3) Directive on the legal protection of databases***
field: third_country
buttons:
  - "Yes"
  - "No"
---
event: territorial_scope_failed
question: Conclusion - The Directive is ***not*** applicable to your case
subquestion: |
  You do not fulfill the conditions required for protection under the Directive, and thus the Directive is not applicable to your situation. 
  
  <font size="2">***Source: Art. 11 Directive on the legal protection of databases***
---
question: Question
subquestion: |
  Are you the lawful user of a database, which has been made public partly or wholly?
  
  
  <font size="2">***Source: Art. 8 Directive on the legal protection of databases***
  
field: user
buttons:
  - "Yes"
  - "No"
---
event: user_applies
question: Conclusion - The Directive ***is*** applicable to your case
subquestion: |
  You qualify as a user within the meaning of the Directive and the rules regarding the protection of user rights as well as the user obligations in Article 8 of the Directive apply to your situation.
  
  
  
  <font size="2">***Source: Art. 8 Directive on the legal protection of databases***
  
  
  
  
  
---
event: protected_fully
question: Conclusion - The Directive ***is*** applicable to your case
subquestion: |
  The conditions for the protection of the database have been fulfilled, and the Directive is applicable. 
  
  
  <font size="2">***Source: Art. 7 and 11 Directive on the legal protection of databases***
---
question: Question
subquestion: |
  Has it been more than 15 years since the completion of the making of the database or the making public of said database?
  
  
  
  <font size="2">***Source: Art.10 Directive on the legal protection of databases***
field: protection_period
buttons:
  - "Yes"
  - "No"
---
event: protection_expired
question: Conclusion - The Directive is ***not*** applicable to your case
subquestion: |
  The term of protection provided by the Directive is 15 years after the completion of the database, or of making the database public. Thus the temporal scope of the Directive is not fulfilled and it is not applicable in your case.
  
  However, any substantial change to the contents of a database, including the accumulation of successive additions, deletions or alterations, which would result in the database being considered to be a substantial new investment, evaluated qualitatively or quantitatively, shall qualify the database resulting from that investment for its own term of protection.
  
  <font size="2">***Source: Art.10 Directive on the legal protection of databases***
  
---
event: author_applies
question: Conclusion - The Directive ***is*** applicable to your case
subquestion: |
  All of the conditions required by the Directive for the protection of the database have been fulfilled, and the Directive is applicable in your case.
  
  
  <font size="2">***Source: Art. 3 and 4 Directive on the legal protection of databases***
  
  
  
  
---
question: Question
subquestion: |
  Is the author of the database a:
  
  - Natural person, a group of natural persons
  
  *OR*
  
  - Where the legislation of the Member States so permits, the legal person designated as the rightholder by that legislation ?
  
  <font size="2">***Source: Art.4 Directive on the legal protection of databases***
field: author
buttons:
  - "Yes"
  - "No"
---
mandatory: True
code: |
  start
  if database_requirements == 'Yes':
    if copyrighted_database == 'No':
      if protection_period == 'No':
        if sui_generis_investment == 'No':
          not_sui_generis_protected
        if sui_generis_investment == 'Yes':
          if sui_generis_extraction == 'No':
            if sui_generis_re_utilization == 'No':
              not_sui_generis_protected
            if sui_generis_re_utilization == 'Yes':
              if national_of_ms == 'No':
                if habitual_resident == 'No':
                  if registered_office == 'No':
                    if third_country == 'No':
                      territorial_scope_failed
                    if third_country == 'Yes':
                      if made_public == 'Yes':
                        protected_partly
                      if made_public == 'No':
                        protected_fully
                  if registered_office == 'Yes':
                    if made_public == 'Yes':
                      protected_partly
                    if made_public == 'No':
                      protected_fully
                if habitual_resident == 'Yes':
                  if made_public == 'Yes':
                    protected_partly
                  if made_public == 'No':
                    protected_fully
              if national_of_ms == 'Yes':
                if made_public == 'Yes':
                  protected_partly
                if made_public == 'No':
                  protected_fully
          if sui_generis_extraction == 'Yes':
            if national_of_ms == 'No':
              if habitual_resident == 'No':
                if registered_office == 'No':
                  if third_country == 'No':
                    territorial_scope_failed
                  if third_country == 'Yes':
                    if made_public == 'Yes':
                      protected_partly
                    if made_public == 'No':
                      protected_fully
                if registered_office == 'Yes':
                  if made_public == 'Yes':
                    protected_partly
                  if made_public == 'No':
                    protected_fully
              if habitual_resident == 'Yes':
                if made_public == 'Yes':
                  protected_partly
                if made_public == 'No':
                  protected_fully
            if national_of_ms == 'Yes':
              if made_public == 'Yes':
                protected_partly
              if made_public == 'No':
                protected_fully
      if protection_period == 'Yes':
        protection_expired
    if copyrighted_database == 'Yes':
      if author == 'Yes':
        author_applies
      if author == 'No':
        not_author_or_rightholder
  if database_requirements == 'No':
    if user == 'No':
      possible_rightholder
    if user == 'Yes':
      user_applies
